INSERT INTO article_translates(article_id,url,html_url,name,title,body,locale) VALUES
(115015959148,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/en-us/articles/115015959148-Help-I-ve-forgotten-my-password-.json','https://help.honestbee.tw/hc/en-us/articles/115015959148-Help-I-ve-forgotten-my-password-','Help! I’ve forgotten my password.','Help! I’ve forgotten my password.','<p>Click on the Forgot Password link on the Login page and enter your registered email address. We’ll send you an email to reset your password. Occasionally emails end up in the junk/spam folder. Take a look there.</p>','en-us'),
(115015959148,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/zh-tw/articles/115015959148-%E6%95%91%E5%91%BD-%E6%88%91%E5%BF%98%E8%A8%98%E5%AF%86%E7%A2%BC%E4%BA%86.json','https://help.honestbee.tw/hc/zh-tw/articles/115015959148-%E6%95%91%E5%91%BD-%E6%88%91%E5%BF%98%E8%A8%98%E5%AF%86%E7%A2%BC%E4%BA%86','救命！我忘記密碼了','救命！我忘記密碼了','<p>請在登入頁面點選「忘記密碼」，並輸入您註冊時所使用的電子信箱。我們會寄給您一封信讓您重設密碼。有時候信件會跑到垃圾信件匣，請務必檢查看看。</p>','zh-tw'),
(115015959188,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/en-us/articles/115015959188-What-can-I-do-when-my-cart-is-locked-.json','https://help.honestbee.tw/hc/en-us/articles/115015959188-What-can-I-do-when-my-cart-is-locked-','What can I do when my cart is locked?','What can I do when my cart is locked?','<p>When there is an error completing your checkout,your cart will be temporarily locked to prevent further changes to your order. To unlock your cart,click ‘Yes,unlock my cart,’ when prompted.</p>','en-us'),
(115015959188,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/zh-tw/articles/115015959188-%E6%88%91%E7%9A%84%E8%B3%BC%E7%89%A9%E8%BB%8A%E9%8E%96%E4%BD%8F%E4%BA%86-%E8%A9%B2%E6%80%8E%E9%BA%BC%E8%BE%A6-.json','https://help.honestbee.tw/hc/zh-tw/articles/115015959188-%E6%88%91%E7%9A%84%E8%B3%BC%E7%89%A9%E8%BB%8A%E9%8E%96%E4%BD%8F%E4%BA%86-%E8%A9%B2%E6%80%8E%E9%BA%BC%E8%BE%A6-','我的購物車鎖住了，該怎麼辦？','我的購物車鎖住了，該怎麼辦？','<p>當結帳出現錯誤時，您的購物車會暫時被鎖住，以避免您的訂單出現異動。要解鎖您的購物車，請在出現提示時，點選「是的，解鎖我的購物車」。</p>','zh-tw'),
(115015885547,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/en-us/articles/115015885547-What-is-honestbee-s-information-security-policy-.json','https://help.honestbee.tw/hc/en-us/articles/115015885547-What-is-honestbee-s-information-security-policy-','What is honestbee’s information security policy?','What is honestbee’s information security policy?','<p>honestbee takes your privacy seriously and complies with all the relevant laws to ensure your details are kept secure. Read our <a href="https://www.honestbee.tw/privacy-policy">Privacy Policy</a> for more information.</p>','en-us'),
(115015885547,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/zh-tw/articles/115015885547-honestbee-%E7%9A%84%E5%AE%89%E5%85%A8%E6%94%BF%E7%AD%96%E7%82%BA%E4%BD%95-.json','https://help.honestbee.tw/hc/zh-tw/articles/115015885547-honestbee-%E7%9A%84%E5%AE%89%E5%85%A8%E6%94%BF%E7%AD%96%E7%82%BA%E4%BD%95-','honestbee 的安全政策為何？','honestbee 的安全政策為何？','<p>honestbee 很重視您的隱私，並遵循所有相關法規以確保您的資訊安全。請閱讀我們的<a href="https://www.honestbee.tw/privacy-policy">隱私權政策</a>以了解更多資訊。</p>','zh-tw'),
(115015885507,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/en-us/articles/115015885507-How-can-I-change-my-email-address-.json','https://help.honestbee.tw/hc/en-us/articles/115015885507-How-can-I-change-my-email-address-','How can I change my email address?','How can I change my email address?','<p>Currently,it’s not possible to change your email address. To register with a different email address,please create a new account.</p>','en-us'),
(115015885507,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/zh-tw/articles/115015885507-%E5%A6%82%E4%BD%95%E6%9B%B4%E6%94%B9%E9%9B%BB%E5%AD%90%E4%BF%A1%E7%AE%B1-.json','https://help.honestbee.tw/hc/zh-tw/articles/115015885507-%E5%A6%82%E4%BD%95%E6%9B%B4%E6%94%B9%E9%9B%BB%E5%AD%90%E4%BF%A1%E7%AE%B1-','如何更改電子信箱？','如何更改電子信箱？','<p>您的電子信箱目前無法更改。若要以不同信箱進行註冊，請建立新帳號。</p>','zh-tw'),
(115015959168,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/zh-tw/articles/115015959168-%E5%A6%82%E4%BD%95%E6%9B%B4%E6%94%B9%E4%BF%A1%E7%94%A8%E5%8D%A1-%E5%AF%86%E7%A2%BC%E6%88%96%E9%80%81%E8%B2%A8%E5%9C%B0%E5%9D%80-.json','https://help.honestbee.tw/hc/zh-tw/articles/115015959168-%E5%A6%82%E4%BD%95%E6%9B%B4%E6%94%B9%E4%BF%A1%E7%94%A8%E5%8D%A1-%E5%AF%86%E7%A2%BC%E6%88%96%E9%80%81%E8%B2%A8%E5%9C%B0%E5%9D%80-','如何更改信用卡、密碼或送貨地址？','如何更改信用卡、密碼或送貨地址？','<p>登入您的帳號並前往右上角的個人資料圖示。在下拉式選單中選擇「設定」來編輯您的資料。</p>','zh-tw'),
(115015959168,'https://honestbeehelp-tw.zendesk.com/api/v2/help_center/en-us/articles/115015959168-How-can-I-change-my-credit-card-password-or-delivery-address-.json','https://help.honestbee.tw/hc/en-us/articles/115015959168-How-can-I-change-my-credit-card-password-or-delivery-address-','How can I change my credit card,password or delivery address?','How can I change my credit card,password or delivery address?','<p>Log in to your account and go to your profile icon at the top right corner. Select Settings from the dropdown menu to edit your details.</p>','en-us'),
(115016053147,'https://honestbeehelp-sg.zendesk.com/api/v2/help_center/en-us/articles/115016053147-How-do-I-prepare-my-laundry-for-pickup-.json','https://honestbeehelp-sg.zendesk.com/hc/en-us/articles/115016053147-How-do-I-prepare-my-laundry-for-pickup-','How do I prepare my laundry for pickup?','How do I prepare my laundry for pickup?','<p>Please be ready with your laundry when the delivery bee comes. Also check that all clothing pockets are empty, as it will be difficult for us to trace personal articles after your laundry has been handed over. We will not be liable for missing personal articles after you hand it over to us as well.</p>','en-us'),
(115015447167,'https://honestbeehelp-sg.zendesk.com/api/v2/help_center/en-us/articles/115015447167-I-want-to-cancel-my-food-order.json','https://honestbeehelp-sg.zendesk.com/hc/en-us/articles/115015447167-I-want-to-cancel-my-food-order','I want to cancel my food order','I want to cancel my food order','<p><strong>Can I cancel my food order? </strong></p>\n<p>You may cancel your order before the restaurant has started preparing it. Simply go to <a href="https://www.honestbee.sg/en/food/orders">Your Orders</a> and select the order you wish to cancel.</p>\n<p>If you do not want your order to be delivered but the food is being prepared or our deliverer is on his way to you, please contact us for assistance. Do note that charges of the food order may still apply to you.</p>\n<p> </p>\n<p><button><a href="javascript:zE.show();zE.activate();">Chat with Us</a></button></p>','en-us'),
(115016039687,'https://honestbeehelp-sg.zendesk.com/api/v2/help_center/en-us/articles/115016039687-I-have-not-received-my-order-confirmation-final-receipt.json','https://honestbeehelp-sg.zendesk.com/hc/en-us/articles/115016039687-I-have-not-received-my-order-confirmation-final-receipt','I have not received my order confirmation/final receipt','I have not received my order confirmation/final receipt','<p>We send you your order confirmation immediately after you have placed an order. There is a chance that it might have ended up in the junk/spam folder. Please let us know if you do not find it there.</p>\n<p><br>We aim to send you your final receipt within 5 working days after we have returned your laundry. Please note that we might adjust your final receipt for any additional articles added to the order and the difference in weight (if any) of your wash and fold loads.</p>\n<p><br>If this answer did not solve your issue, please contact us and we will do our best to make things right for you. </p>','en-us'),
(115015433907,'https://honestbeehelp-sg.zendesk.com/api/v2/help_center/en-us/articles/115015433907-What-if-I-am-not-at-home-to-receive-my-order-.json','https://honestbeehelp-sg.zendesk.com/hc/en-us/articles/115015433907-What-if-I-am-not-at-home-to-receive-my-order-','What if I am not at home to receive my order?','What if I am not at home to receive my order?','<p>If you missed your delivery, please contact us as soon as possible. We will do our best to reschedule your delivery. We reserve the right to charge an additional redelivery fee of $15. Perishables such as meat and frozen food may be discarded in accordance with Food Safety Standards, and are not refundable on your order. </p>\n<p> </p>\n<p><button><a href="javascript:zE.show();zE.activate();">Chat with Us</a></button></p>','en-us');
